import React, { useEffect } from "react";
import { navigate } from "@reach/router";
import Parallax from "parallax-js";
import logo from "../media/logo.png";
import py from "../media/py.png";
import bs from "../media/bs.png";
import html from "../media/html.png";
import css from "../media/css.png";
import sass from "../media/sass.png";
import js from "../media/js.png";
import jq from "../media/jq.png";
import java from "../media/java.png";
import npm from "../media/npm.png";
import sql from "../media/sql.png";
import "../App.css";
import "../Anime.scss";
import resumeData from "./resumeData";
export default function Landing() {
  const Parallax = require("parallax-js");
  var scene = document.getElementById("scene");
  // useEffect(()=>{
  //   if(scene!=undefined){
  //     var parallaxInstance = new Parallax(scene);
  //   }
  // })
  return (
    <div className="bg">
      <div className="container">
        <div id="scene">
          {/* <div data-depth="0.2">My first Layer!</div>
          <div data-depth="0.6">My second Layer!</div> */}
          <img src={logo} className="land-logo" alt="Logo" />
          <wrapper></wrapper>
          <img src={py} className="py"/>
          <img src={bs} className="bs"/>
          <img src={html} className="html"/>
          <img src={css} className="css"/>
          <img src={sass} className="sass"/>
          <img src={js} className="js"/>
          <img src={jq} className="jq"/>
          <img src={java} className="java"/>
          <img src={npm} className="npm"/>
          <img src={sql} className="sql"/>
          <br />
          <div class="section three">
            <div id="button" onClick={nav}>
              Enter
              <div class="ring one"></div>
              <div class="ring two"></div>
              <div class="ring three"></div>
              <div class="ring four"></div>
            </div>
          </div>
          <br />
        </div>
        <footer style={{ marginBottom: "0px" }}>
          <div className="row" style={{ paddingTop: "175px" }}>
            <div className="twelve columns">
              <ul className="social-links">
                {resumeData.socialLinks &&
                  resumeData.socialLinks.map(item => {
                    return (
                      <li>
                        <a href={item.url}>
                          <i className={item.className} />
                        </a>
                      </li>
                    );
                  })}
              </ul>
            </div>
          </div>
        </footer>
      </div>
      <script src="parallax.js" type="text/javascript"></script>
    </div>
  );
}

function nav() {
  navigate("/home");
  return window.location.reload(false);
}
